import React, { useEffect } from 'react';
import TaskList from './TaskList';

const TasksShownPage = ({ tasks, onDeleteTask, fetchTasks }) => {
  useEffect(() => {
    fetchTasks();
  }, [fetchTasks]);

  return (
    <div>
      <h2>Tasks Shown</h2>
      {tasks.length === 0 ? (
        <p>No tasks found.</p>
      ) : (
        <TaskList tasks={tasks} onDeleteTask={onDeleteTask} />
      )}
    </div>
  );
};

export default TasksShownPage;
